%[text] # Spectral Fault Receptive Fields
%[text] ## What are SFRFs?
%[text] Spectral Fault Receptive Fields (SFRFs) are a computational framework inspired by the concept of receptive fields in the retinal ganglion cells of primates. In condition monitoring and prognosis, SFRFs analyze spectral features of signals to capture degradation patterns as they manifest in *characteristic frequency bands*. They act as optimized contrast filters linking spectral patterns with machine conditions, supporting diagnosis-informed prognosis.
%[text] 
%[text] ## Biological Inspiration
%[text]{"align":"center"} ![Center-surround receptive field organization in primate retinal ganglion cells](text:image:9338)
%[text] **Figure 1**: Center-surround receptive field organization in primate retinal  ganglion cells. The inset (top left) shows the spectral sensitivity peaks of  cone photoreceptors at different wavelengths. The retinal architecture computes  receptive fields in ganglion cells responsible for encoding visual images. A  receptive field defines the region of the visual field (top right) where light  stimulation modulates the firing rate of a ganglion cell. In the figure, photons  are transduced by photoreceptor cells (only cones are depicted here) that excite  or inhibit bipolar cells. Horizontal cells feedback surround information that  antagonizes the forward propagation of information. This neural circuitry  generates chromatic contrast-sensitive responses, particularly in midget  ganglion cells, facilitating edge detection and color discrimination. The  transformation in the direction of the arrow is often modeled with a difference  of Gaussians model where a spatially sharp center is antagonized by a smooth  wider-spanning surround (bottom left). Micrograph inset modified from  [Librepath 2015](https://commons.wikimedia.org/wiki/File:Retina_%2D%2D_intermed_mag.jpg#/media/File:Retina_%2D%2D_high_mag.jpg) - Wikimedia Commons. 
